import React from 'react'
import axios from 'axios'
const AllProducts = (props) => {
  let products = { props }
  return (
    <div>
      <h2>All products</h2>
      {products.map((product, i) => (
        <p key={i}>title: {product.title}</p>
      ))}
    </div>
  )
}

export default AllProducts
